import React, {useContext, useEffect} from 'react'
import ProductsContext from "../Contexts/ProductContext"

const Clothing = ({products}) => {

    const Products = useContext(ProductsContext)

    useEffect(() => console.log("cloth", Products)) 

    const clothingProducts = products.map(prod => prod)

    const filteredClothing = clothingProducts.category.filter((product) => {
        return product.category.includes("clothing")
    })

    return (
    <div>
        {filteredClothing}
    </div>
    )
}
export default Clothing
